INSERT INTO `evercisegroups` (`id`, `user_id`, `venue_id`, `name`, `title`, `description`, `gender`, `image`, `capacity`, `default_duration`, `default_price`, `published`, `created_at`, `updated_at`) VALUES
(1, 9, 1, 'Upper Body Blitz', '', 'An explosive upper body class using the best and most effective techniques. Based in Holborn for a great start to your morning.', 0, '001.jpg', 12, 0, '8.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(2, 10, 2, 'Bootcamp - Tuesday Body Blitz', '', 'Burn fat, build lean muscle, improve your fitness, train hard whilst still feeling that individual service in a group of friendly people with the same goals as you!', 0, '72-image.jpg', 10, 45, '5.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(3, 10, 3, 'Bootcamp Thursdays with ATP', '', 'No matter the weather or your current fitness ability, you will be covered during this class which will burn fat, build lean muscle, get your body moving better than before and all of this done in a group who are looking for the same things you are. ', 0, '72-0002.jpg', 10, 45, '5.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(4, 10, 4, 'High Intensity Body Sculpt', '', 'Sculpt, tone, build and burn! This class will get your body moving with weight training, plyometrics, cardio, core and more. Join ATP Fitness for a truly effective workout for guys and girls!', 0, '72-shutterstock_124015816.jpg', 15, 60, '5.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(5, 9, 5, 'HIIT Training', '', 'A high intensity cardio resistance based session designed to leave you feeling pumped, focused and ready for anything. Combining high intensity cv exercises and speed resistance training-this is a workout not to be missed.', 0, '71-image.jpg', 15, 60, '10.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(6, 9, 6, 'Ladies only kickboxing', '', 'Martial arts based workout for ladies only. Great way to stress bust and keep fit.', 0, 'ATP_andy001.jpg', 10, 45, '19.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(7, 10, 7, 'Outdoor Kickboxing', '', 'Want to learn a new skill, release some tension, tone that body or just have a great workout? Then join us for kickboxing in the park!', 0, 'ATP_andy001.jpg', 10, 45, '10.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(8, 88, 8, 'Pilates (all levels)', '', 'A conditioning class designed to improve muscle tone and flexibility and to improve general posture. This class is great for the first timer to the more advanced. It can help with sports injuries and pre / /post natal.', 0, '237-1_display_pic.jpg', 15, 60, '10.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(9, 88, 9, 'Pilates for all levels', '', 'Pilates will help to tone and stretch the muscles. It also helps to improve posture and strengthen core muscles. Great for injury rehabilitation.', 0, '237-436._ADV_single_leg_raise.jpg', 15, 60, '10.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(10, 90, 10, 'Special Saturday Vinyasa Flow', '', 'A one-off Saturday Vinyasa Flow class, from 1-2pm on Saturday 7th December at our Angel space, in the Upper Hall at Claremont.  Expect a flowing class that uses creative sequencing and accompanying music to flow through postures designed to increase your ', 0, '240-1476605_570101706389408_409676528_n.jpg', 20, 60, '10.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(11, 9, 11, 'Studio Yoga', '', 'Yoga is an ancient form of exercise that focuses on strength, flexibility and breathing to boost physical and mental wellbeing. This yoga class is appropriate for beginners that help you go beyond your normal range of movement.', 0, '71-shutterstock_yoga.jpg', 15, 60, '10.00', 1, '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(12, 26, 12, 'Swag Hip-Hop', '', 'A great workout /dance based class great for cardio and taught by a professional commercial dancer Matt Knight. Let the energy move you!', 0, '104-image.jpg', 15, 60, '10.00', 1, '2014-07-17 15:41:34', '2014-07-17 15:41:34'),
(13, 111, 13, 'HIIT Training', '', 'High intensity resistance training intervals in a gym based environment for a workout you will never forget hitting arms legs abs and core this class will leave you pumped and ready for anything.', 0, '262-image.jpg', 15, 60, '10.00', 1, '2014-07-17 15:41:34', '2014-07-17 15:41:34'),
(14, 9, 14, 'Gym-tastic', '', 'Use the gym like never before in this man vs machine, gym based workout. Sprint training , core blasting will leave your muscles screaming for more.', 0, '71-image.jpg', 10, 60, '10.00', 1, '2014-07-17 15:41:34', '2014-07-17 15:41:34'),
(15, 10, 15, 'ATP Studio Kickboxing', 'Uytroiuu', 'Join us for a fun, hard and educational kickboxing workout in a studio in Central London that will challenge anyone.', 0, '72-image.jpg', 10, 1, '10.00', 1, '2014-07-17 15:41:34', '2014-07-17 15:41:34'),
