(57, 211, 57, 'Personal Training', 'What to lose bodyfat? Improve muscular shape ', 'Whether you wish to lose body fat, improve your muscle tone and shape or increase muscular strength and size I can help you. By applying the principles of High Intensity Training and Nutrition you can achieve maximum results in the minimum amount of time.', 0, 'RJ_Logo_v1.jpg', 2, 60, '30.00', 1, '2014-07-17 15:41:36', '2014-07-17 15:41:36'),
