(111, 194, 103, 'Burlexercise', '', 'Burlexercise is a medium - high intensity fitness class designed specifically for an all over body workout. Our classes take you on a physical journey, burning calories, toning and tightening all those problem areas from top to bottom, whilst incorporating token showgirl elements. \n\nOur focus is to get you fit, in shape and feeling body confident but most importantly we''ll make sure you are having fun exercising!\n\nThe creators of Burlexercise have taken inspiration from their careers as London West End dancers, fitness instructors, personal trainers and also professional Burlesque performers to bring you an exercise class like no other!\n', 0, '1406549086_image-3.jpeg', 20, 60, '10.00', 0, '2014-07-28 11:04:48', '2014-07-28 11:04:48'),
(114, 141, 106, 'Running class', '', 'Running class is for anyone who wants to improve their running skills. My classes will prepare you for marathons. Classes are for both men and women.', 0, '1406644329_2.jpg', 10, 80, '12.50', 0, '2014-07-29 13:34:22', '2014-07-29 13:34:22'),
