(118, 193, 38, 'PT Dance Fitness for Women', '', 'Chose your dance style lesson: from afro / dancehall with TYGA® UK with Aem or The Jungle Body to Holistic Fitness with Bhangra, Bellydancing, yoga, pilate inspired moves. You chose. Videos available to help you decide.\n> No dance experience required.', 2, '1406819477_Screen_Shot_2014-05-.png', 5, 60, '25.00', 0, '2014-07-31 14:16:45', '2014-07-31 14:16:45'),
(119, 162, 21, '4 weeks Zumba course  ', '', 'Zumba is pretty much alive and in the peak of its move around the world, but sometimes is needed to re-shape & reassure the we follow it properly, so this course is for all purpose & level & ages. If you feel that the zumba music takes you to another fitness level, but want to get the steps & choreographics right, then this is your chance! just for £32 to have all the core steps breakdown in details and the rhythm of the music with a native instructor at the right tempo.\n\nThe focus of the workshop programme is to break down the key elements of Zumba basic steps and progressively incorporate them into routines. Each workshop will consist of warm up, body isolation, and a routines. The aim is to deliver a fun body workout, improving rhythm, balance, coordination and stamina while having fun', 0, '1406892392_zumba_beginners.jpg', 20, 60, '32.00', 0, '2014-08-01 10:26:42', '2014-08-01 10:26:42'),
(120, 162, 21, '4 Week Salsa & Merengue course', '', 'This workshop is the one people were waiting for so let''s get on with it.\n\nSalsa from Cuba & Merengue from Dominican Republic are sweeping the Latin music world their irrepressible blend of tropical beat rhythms. Today many of the most popular bars, restaurants and night clubs are engaged with artists come from Puerto Rico, Cuba, NY, Colombia to enlight the international capital of music "London" so is the time to get inti their beat!\n\n4 WORKSHOP AT AN UNBELIEVABLE PRICE now in London! £32\n\nLearn the beat, body language, leading techniques and the steps broken down with the right tempo', 0, '1406892757_salsa_and_merengue.jpg', 20, 60, '32.00', 0, '2014-08-01 10:34:52', '2014-08-01 10:34:52'),
(121, 162, 20, '4 Week Samba Course W6', '', 'TAKE OFF To the Brazilian dance mood & Carnival with the international Samba Rhythm.\n\nSamba is pretty much well known as the core of the Brazilian dance rhythm, the international arena talks about it and get sweeten with the sound of its music, the Rio & Notting Hill carnival in London are impregnated of its flavour, custom and people so we have the chance to get down to the dancing and enjoy even more this fantastic and rich sound of the Berimbao, Cavaquinho and Pandeiro just around the corner in Hammersmith W6 with the international well known Patricia Reiss.\n\n4 WORKSHOPS AT AN UNBELIEVABLE PRICE now in London! £32\n\nThe focus of the workshop programme is to break down the key elements of Samba and progressively incorporate them into routines. Each workshop will consist of warm up, body isolation, and a routine. The aim is to deliver a fun body workout, improving rhythm, balance, coordination and stamina while having fun.', 0, '1406893079_SAMBA_workshop.jpg', 20, 60, '32.00', 0, '2014-08-01 10:46:23', '2014-08-01 10:46:23'),
