(161, 379, 121, 'Gukwoone Mixed Martial Arts', '', 'Gukwoone is a new martial art system that incorporates techniques from Taekwondo, Muay-Thai, Ju-Jitsu and Kabudo (weapons). The overall ultimate objective of learning Gukwoone is to cultivate a disciplined mind body and spirit. Everyone Welcome!', 0, '1407765806_Screen_Shot_2014-07-.png', 10, 120, '5.00', 0, '2014-08-11 14:58:22', '2014-08-11 14:58:22'),
(162, 195, 67, 'strength ', '', 'Light warm up, then various weighted exercises or body weight exercises, timed with repetitions, or sprint based cardio work out, staircase runs included.', 0, 'DSC_0141.jpg', 10, 45, '7.00', 0, '2014-08-11 17:15:43', '2014-08-11 17:15:43'),
(163, 195, 67, 'strength ', '', 'Light warm up, then various weighted exercises or body weight exercises, timed with repetitions, or sprint based cardio work out, staircase runs included.', 0, 'DSC_0141.jpg', 10, 45, '7.00', 0, '2014-08-11 17:16:36', '2014-08-11 17:16:36'),
(164, 384, 122, 'BarreTone', '', 'Every body is raving about the latest fitness trend sweeping the nation. Barre training has been made popular thanks to the likes of Madonna, Kelly Ripa, and Natalie Portman. \n\nBarreTone is fully functioning workout, which stretches and sculpts muscles, whilst burning fat.\n\nBarreTone improves flexibility, balance, strength, stamina and power.\n\nInspired by Ballet, Pilates and Yoga based principles with movements to fun and vibrant music.\n\nIt is a total body workout lifts the butt, tones the thighs, flattens the abs and sculpts the arms, whilst protecting the joints. \n\n \n\nEven better it is only 6 persons per class.\n\n ', 0, '1407854393_7625c3_84c4e857295d4.jpg', 6, 60, '24.00', 0, '2014-08-12 13:40:57', '2014-08-12 13:40:57'),
(169, 384, 123, 'Urban Fun', '', 'URBANFUN is a short and effective 30 minute High Intensity Interval Training Outdoor classes - it involves short intervals of maximum intensity exercise separated by longer intervals of low to moderate intensity exercise. Because it involves briefly pushing yourself beyond the upper end of your aerobic exercise zone, it offers you several advantages that traditional steady-state exercise can’t provide:\n\n ', 0, '1407855768_7625c3_b96473e5a131b.jpg', 8, 30, '8.00', 0, '2014-08-12 14:27:26', '2014-08-12 14:27:26'),
(170, 384, 122, 'Pilates FUSION ', '', 'Experience a 2 in 1 class mixing Aerobic and anaerobic training mixed up with Mat-based PILATES\n\nBenefits include: \n\nImprove Posture;\nMuscle strength and flexibility;\nImprove core strength & Joint mobility;\nHelp back pain;\nSuitable for all ages.', 0, '1407859744_7625c3_1335e5546d254.jpg', 5, 45, '20.00', 0, '2014-08-12 15:09:04', '2014-08-12 15:09:04'),
(171, 384, 122, 'Pilates', '', 'A form of exercise that focuses on using both the mind and body to achieve optimum performance. Targeting the deep stabilizing muscles of the body using sequences of movements that use gravity and body weight. Pilates trains the mind to maintain a constant level of awareness of the way the body moves. This results in a greater control of motion and vastly improved technique. Connecting the body and mind is crucial for Pilates.', 0, '1407860579_7625c3_b0ca3a6703974.jpg', 6, 60, '20.00', 0, '2014-08-12 15:28:30', '2014-08-12 15:28:30'),
(172, 384, 122, 'Dynamic Hatha Yoga', '', 'This class is designed to invigorate without exhausting you, helping you to start your week on the right foot (and left foot too!), helping you to keep a clear and calm mind throughout your week. The sequences are slow-paced but energizing, giving your body a chance to wake up and warm up while getting a good sweat before cooling down and resting in savasana. Who needs a coffee after that? \n', 0, '1407919570_7625c3_145f9faebbf34.png', 8, 60, '16.00', 0, '2014-08-13 07:49:38', '2014-08-13 07:49:38'),
(175, 384, 122, 'Yoga Beginners', '', 'Experience a 5000-year-old Indian body of knowledge. YOGA is all about harmonising the body with the mind and breath through the means of various breathing techniques.', 0, '1407925889_7625c3_37ac8abae8704.jpg', 8, 60, '16.00', 0, '2014-08-13 09:31:53', '2014-08-13 09:31:53'),
(176, 384, 122, 'Yoga Relax', '', 'Drawing the inspiration from Yin Yoga and meditation techniques, this class will be mostly focusing on slowing down.', 0, '1407928256_10153002_78723743128.jpg', 6, 60, '20.00', 0, '2014-08-13 10:25:38', '2014-08-13 10:25:38'),
(179, 384, 122, 'Yoga Ashtanga Beginners ', '', 'Experience a 5000-year-old Indian body of knowledge. YOGA is all about harmonising the body with the mind and breath through the means of various breathing techniques.', 0, '1407929914_10347500_79313804069.jpg', 8, 60, '16.00', 0, '2014-08-13 10:59:06', '2014-08-13 10:59:06'),
(180, 384, 122, 'Yoga Flow', '', 'A gentle version of powerful set of asanas where you choose how much you''d like to do today. A bit of sweat if you allow yourself to go further, or-if you are not having a particularity strong day, there is a choice to take it easier as the class provides variations. We have a bit of fun while we regulate energy in the body and finish with Savasana (relaxation) at the end. All levels welcome.', 0, '1407935647_10006320_77797323888.jpg', 8, 60, '16.00', 0, '2014-08-13 12:18:21', '2014-08-13 12:18:21'),
(181, 384, 122, 'Yoga Dynamic', '', 'Please be prepared to sweat as we rotate the energy. This is a session of flowing and powerful set of asanas and transitions along with simple pranayama. The class is inspired by the ancient Ashtanga Vinyasa traditions, strongly balancing all body systems following by relaxation.', 0, '1408006795_10390496_80031830331.jpg', 8, 60, '16.00', 0, '2014-08-14 08:00:03', '2014-08-14 08:00:03'),
(184, 384, 122, 'Yoga Ashtanga', '', 'Experience a 5000-year-old Indian body of knowledge. YOGA is all about harmonising the body with the mind and breath through the means of various breathing techniques. ', 0, '1408009672_10426824_82428199758.jpg', 8, 60, '16.00', 0, '2014-08-14 14:03:23', '2014-08-14 14:03:23'),
(185, 384, 122, 'Hatha Yoga', '', 'Hatha Yoga - "My body is my temple, asanas are my prayer" - BKS Iyengar. Guru BKS Iyengar was one of the first yogis to introduce Hatha yoga to the west and has passed on his teaching to many thousands of students world wide. A Hatha class can be challenging on a fitness level as well as being restorative and restful, a balance is always the aim. The sequence in each class is unique and specific modifications will be given to individuals. A focus on awareness and alignment of the body and energies ultimately encourage health of both body and mind. \n', 0, '1408029932_ihumanfitness3.jpg', 8, 60, '16.00', 0, '2014-08-14 14:29:43', '2014-08-14 14:29:43'),
(186, 384, 122, 'Yoga Pregnancy', '', 'A special time for both the expecting mother and her unborn infant. Prenatal yoga is ideal for helping you to connect with your breath and your baby while accepting and embracing the constant changes that are happening to your body. This is achieved by learning a variety of breathing techniques and by combining gentle stretching exercises with strengthening asanas, particularly focusing on the legs, which will help you to find comfortable positions during pregnancy and birth. You’ll be encouraged to focus on breathing slowly and deeply in order to promote relaxation and to help reduce stress. Not only is this great for improving circulation, which benefits both yourself and your growing baby, it will also be enormously beneficial during the birth itself. The more you practice breathing exercises during pregnancy, the more you train yourself to relax and are more likely you are to breath deeply, keep calm and work through contractions during labour.The class can also help to relieve fatigue and provide renewed energy, which is great if your energy levels are low.\n\n ', 0, '1408032090_shutterstock_1907329.jpg', 8, 60, '16.00', 0, '2014-08-14 15:03:41', '2014-08-14 15:03:41'),
(187, 384, 122, 'Yoga Postnatal', '', 'Birthing a baby is emotionally and physically challenging. With so many things going on with your body and mind a postnatal yoga class can be the perfect place to acknowledge and accept the changes. The sessions can be carried out from immediately after birth and are tailored depending on how soon after birth it takes place and your personal birth story. ', 0, '1408054683_shutterstock_1189068.jpg', 8, 60, '16.00', 0, '2014-08-14 21:18:12', '2014-08-14 21:18:12'),
(188, 384, 122, 'Hatha Yoga  Restore & energise', '', 'Hatha Yoga - "My body is my temple, asanas are my prayer" - BKS Iyengar. Guru BKS Iyengar was one of the first yogis to introduce Hatha yoga to the west and has passed on his teaching to many thousands of students world wide. A Hatha class can be challenging on a fitness level as well as being restorative and restful, a balance is always the aim. The sequence in each class is unique and specific modifications will be given to individuals. A focus on awareness and alignment of the body and energies ultimately encourage health of both body and mind. ', 0, '1408055326_shutterstock_1670271.jpg', 8, 60, '16.00', 0, '2014-08-14 21:34:10', '2014-08-14 21:34:10'),
(189, 395, 124, 'Krav Maga Self Defence Classes', '', 'Learn devastatingly effective techniques that will give you the confidence and security of knowing that if you are ever attacked, you can seriously neutralize any opponent, no matter how big they are. Learn how to escape from chokes, holds and locks and counter attack. We deal with multiple attackers whether they are armed with sticks, bottles or knives.\r\n\r\nTry a trial class and see if Krav Maga is for you', 0, 'kravmaga189_user395.jpg', 15, 85, '5.00', 0, '2014-08-15 09:52:43', '2014-08-15 09:52:43'),
(191, 394, 126, 'Bootcamp in Clapham', '', 'Each day is different, with workouts for various areas of the body and spirit to improve your overall health. The outdoor training can include one or more of the following:\r\nStatic and dynamic stretching / Running/walking / Stair-climbing / Resistance training with dumbbells, medicine balls, body weight, bands/tubing, sand / Obstacle courses / Plyometrics (speed/strength training drills) / Hill training / Power yoga / Ab and core training / Agility and power drills / Partner drills/team drills / Jumping rope ', 0, '1408098823_shutterstock_1793224.jpg', 6, 50, '10.00', 0, '2014-08-15 10:59:35', '2014-08-15 10:59:35'),
(193, 394, 126, 'Personal Training - 121', '', '1-2-1 personal training session in Clapham Common Park.\r\n\r\nWhether your goal is permanent weight loss, muscle toning, strength building or enhanced physical performance, I will design a program that is tailored to your needs and will help you meet your fitness goals quickly.\r\n\r\nI have experience in: \r\nWeight training / Body sculpting / Sports conditioning / Core stability / Nutrition coaching\r\n', 0, '1408104254_shutterstock_1787286.jpg', 1, 120, '75.00', 0, '2014-08-15 11:08:50', '2014-08-15 11:08:50'),
(194, 397, 127, '121 Personal Training Session', '', 'No matter if you’re looking to lose a few pounds or a lot of pounds. I have helped many, many people reach their goal weight. I employ a variety of different methods and techniques to make losing weight fun and enjoyable. Now you look forward to exercise!', 0, '1408105522_shutterstock_1326262.jpg', 1, 90, '60.00', 0, '2014-08-15 11:25:27', '2014-08-15 11:25:27'),
(195, 378, 128, 'INSANITY', '', 'Want to burn up to 1000 calories, shred fat, tone muscle and get in the best shape of your life?? Your new favourite INSANITY workout is here. Based on MAX Interval Training an INSANITY class is an abbreviated 50 minute version of the DVD program. ', 0, 'insanity195_user378.jpg', 10, 50, '10.00', 0, '2014-08-15 11:55:20', '2014-08-15 11:55:20'),
(196, 378, 129, 'INSANITY', '', 'Want to burn up to 1000 calories, shred fat, tone muscle and get in the best shape of your life?? Your new favourite INSANITY workout is here. Based on MAX Interval Training an INSANITY class is an abbreviated 50 minute version of the DVD program. ', 0, 'insanity196_uesr378.jpg', 10, 50, '10.00', 0, '2014-08-15 12:02:33', '2014-08-15 12:02:33'),
