(202, 401, 131, 'Yoga ', '', 'I welcome yoga students with all abilities, new and experienced, men, women of all shapes, sizes and ages. Now you just need to get your rear HERE and do something really healthy for you and everyone who comes in contact with you.\r\n\r\nPlease don''t worry and please don''t wait.', 0, '1408110435_shutterstock_1341354.jpg', 5, 45, '18.00', 0, '2014-08-15 12:56:05', '2014-08-15 12:56:05'),
(203, 402, 133, 'Fitness class for ladies - 3S', '', ' For Women only  Non-stop cardio dance moves that does not require any dancing experience. Targets all the muscles and uses specialized sexy moves. We dare you to be SEXY, SASSY and SENSATIONAL. All levels are welcome and all ages can be sexy!!!', 2, '1408112324_shutterstock_2090184.jpg', 3, 60, '8.00', 0, '2014-08-15 13:19:47', '2014-08-15 13:19:47'),
(205, 216, 61, 'Jumping Fitness (Beginners)', '', 'A 60-minute workout focusing on your technique, learning movements and the fundamentals of jumping, so you get the most out of your workout. A combination of jumps using HIIT (High Intensity Interval Training). The complexity of the exercises will guarantee that your whole body will be strengthened.  ', 0, 'Jumping205_user216.jpg', 4, 60, '10.00', 0, '2014-08-15 13:59:55', '2014-08-15 13:59:55'),
(206, 216, 61, 'Jumping Fitness (Intermediate)', '', 'A 45-minute intense workout using different exercise method so you get the most effective workout. A combination of fast and slow jumps, using different energy systems. If you stay at a steady intensity level throughout your workout, your body goes into fat-conserving mode just after your workout, but we can avoid this using interval training. Changing your intensity level every few minutes. You’ll continue to burn calories long after the workout is over. \r\nLose yourself in the music, find your energy levels soaring and have a good time as you jump your way to better health.\r\n', 0, '1408115187_logo_100_(1).png', 4, 60, '10.00', 0, '2014-08-15 14:26:36', '2014-08-15 14:26:36'),
(207, 216, 134, 'Jumping Fitness (Beginners)', '', 'A 60-minute workout focusing on your technique, learning movements and the fundamentals of jumping, so you get the most out of your workout. A combination of jumps using HIIT (High Intensity Interval Training). The complexity of the exercises will guarantee that your whole body will be strengthened.  ', 0, '1408119564_logo_100_(1).png', 4, 45, '10.00', 0, '2014-08-15 15:22:05', '2014-08-15 15:22:05'),
(208, 440, 135, 'Circuit Class', '', 'This is a great Circuit Class, please come and join it. You will enjoy the excitement from this class!!!', 0, '1408357998_shutterstock_6143398.jpg', 10, 60, '6.00', 0, '2014-08-18 09:33:21', '2014-08-18 09:33:21'),
(209, 384, 122, 'BOOM Dynamic', '', 'BOOM is a short and effective 25-40 minute High Intensity Interval Training class, that involves short intervals of maximum intensity exercise separated by longer intervals of low to moderate intensity exercise. Because it involves briefly pushing yourself beyond the upper end of your aerobic exercise zone, it offers you several advantages that traditional steady-state exercise can’t provide.', 0, '1408359032_7625c3_c1cc6d4272274.jpg', 5, 35, '12.50', 0, '2014-08-18 09:53:15', '2014-08-18 09:53:15'),
(210, 384, 122, 'BOOM FFF', '', ' Experience a unique way of training, compounding Cardio Vascular training with Strength training. Build on functional movement, mimicking our daily life routine in a dynamic way regardless of your fitness level or age. Helping you achieve your goal, whatever it is.\r\n\r\n ', 0, '1408359759_safe_image.php.jpg', 5, 35, '12.50', 0, '2014-08-18 10:03:53', '2014-08-18 10:03:53'),
(211, 384, 122, 'BOOM Conditioning ', '', 'BOOM Conditioning Class is aimed at improving both your strength and cardiovascular ability in the same workout. Ben can tailor the class to suit your individual sport or activity requirements whilst keeping the whole group exercising together in a fun and motivating environment. You will be performing variations and progressions of some familiar exercises and also learn new exercises as you develop and improve your fitness. ', 0, '1408360258_923954_2712456097234.jpg', 5, 30, '12.50', 0, '2014-08-18 10:11:50', '2014-08-18 10:11:50'),
(212, 384, 122, 'BOOM ', '', 'BOOM is a short and effective 25-40 minute High Intensity Interval Training class, that involves short intervals of maximum intensity exercise separated by longer intervals of low to moderate intensity exercise. Because it involves briefly pushing yourself beyond the upper end of your aerobic exercise zone, it offers you several advantages that traditional steady-state exercise can’t provide.', 0, '1408361058_10623753_85349299134.jpg', 5, 35, '12.50', 0, '2014-08-18 10:30:37', '2014-08-18 10:30:37'),
(213, 384, 122, 'BOOM KB', '', 'BOOM Kettlebell is an excellent tool for a full body workout, so simple and yet provides a versatile choice of workouts. Perfect for improving endurance, stamina, body building, weight-loss and going easy on the joints at the same time. It''s an optimal training tool for everyone.', 0, '1408361612_10424489_24998784187.jpg', 5, 40, '12.50', 0, '2014-08-18 10:36:49', '2014-08-18 10:36:49'),
(214, 384, 122, 'BOOM Parkour', '', 'The art du displacement is the art of moving the human body as efficiently as possible through space, no matter the obstacles you may face. \r\n\r\nPower, speed, flexibility, balance, coordination and agility are essential to parkour. Using parkour conditioning drills you will develop and improve in all aspects of your  fitness. \r\n\r\nBOOM Parkour will rock your fitness.', 0, '1408362027_1515256_147195247302.jpg', 5, 30, '12.50', 0, '2014-08-18 10:41:18', '2014-08-18 10:41:18'),
(215, 384, 122, 'BOOM MMA', '', 'BOOM is a short and effective 25-40 minute High Intensity Interval Training class, that involves short intervals of maximum intensity exercise separated by longer intervals of low to moderate intensity exercise. Because it involves briefly pushing yourself beyond the upper end of your aerobic exercise zone, it offers you several advantages that traditional steady-state exercise can’t provide.', 0, '1408362297_71422_78291893505284.jpg', 8, 40, '8.00', 0, '2014-08-18 10:47:13', '2014-08-18 10:47:13'),
(218, 461, 136, 'Circuit Conditioning', '', 'A fun and energetic old-school circuit class delivering quick and satisfying results with a few twists.', 0, '1408370464_circuitclass.png', 16, 60, '5.00', 0, '2014-08-18 13:12:24', '2014-08-18 13:12:24'),
(220, 379, 117, 'GMMA Fight Club', '', 'GMMA Fight Club\r\nWould like to welcome all fighters from all martial arts backgroung to practice,shape up and develop your fighting skills in friendly and safe enviroment.\r\nAll fighters need to bring their own: boxing gloves,gum shield,shin pads and groin guard.\r\nAll participants need to be insured.\r\nInsurance can be purchased at the venue.', 0, '1408442387_Screen_Shot_2014-07-.png', 10, 60, '5.00', 0, '2014-08-19 09:06:32', '2014-08-19 09:06:32'),
(221, 379, 138, 'Gukwoone Mixed Martial Arts', '', 'Gukwoone is a new martial art system that incorporates techniques from Taekwondo, Muay-Thai, Ju-Jitsu and Kabudo (weapons). The overall ultimate objective of learning Gukwoone is to cultivate a disciplined mind body and spirit. Everyone Welcome!', 0, '1407765806_Screen_Shot_2014-07-.png', 10, 90, '5.00', 0, '2014-08-19 09:16:24', '2014-08-19 09:16:24'),
(222, 141, 106, 'Running class', '', 'Running class is for anyone who wants to improve their running skills. My classes will prepare you for marathons. Classes are for both men and women.', 0, '1408451694_Aquaspin33_user171.jpg', 10, 80, '12.50', 0, '2014-08-19 11:35:04', '2014-08-19 11:35:04'),
(223, 378, 139, 'INSANITY in the Park Silent Disco Style', '', 'Same awesome INSANITY workout just with a twist. We will all be wearing a pair of wireless headsets which is how you will hear both the music and my cues.. Silent Disco style. The first one was such a success we''re doing it again!', 0, '1407418334_insanity-class-gates.jpg', 10, 50, '10.00', 0, '2014-08-19 12:18:50', '2014-08-19 12:18:50');
