(31, 394, 73, 1280, 191, 417, 4, 'You get wayy more than what you''ve paid for with that class! #believeme', '2014-07-25 21:57:10', '2014-08-18 16:57:02'),
(32, 394, 76, 1281, 191, 417, 4, 'When your legs hurt, but you have a smile on your face, that means that you did a great job! If you want to work hard, I better see you next week! :) I will definitely be IN! ', '2014-08-02 06:32:39', '2014-08-18 16:59:39'),
(33, 394, 81, 1283, 191, 417, 5, 'Addictive! ', '2014-08-15 21:21:10', '2014-08-18 17:00:10'),
(34, 402, 110, 1297, 203, 409, 3, ' I just discovered that 3 S concept and it is awesome!! I can''t wait to come back to London to try another class! Note: I wish the class had more flexibility about the time though... ', '2014-08-11 21:45:56', '2014-08-18 17:03:56'),
(35, 397, 92, 1290, 194, 412, 4, 'friendly people, quite small, but brill personal trainer! ', '2014-08-07 10:08:02', '2014-08-18 17:08:02'),
(36, 397, 93, 1291, 194, 415, 5, 'I loved this! It was perfect for my preparation of my next tennis competition! ', '2014-08-04 09:10:32', '2014-08-18 17:10:32'),
(37, 394, 72, 1280, 191, 421, 5, 'Overall, it''s just exciting! A great way to start your week end', '2014-08-10 08:13:55', '2014-08-18 17:13:55'),
(38, 401, 100, 1294, 202, 422, 5, 'A positive experience! I felt so relaxed then. And now I know that I really have to work on my flexibility. :) ', '2014-07-25 20:52:25', '2014-08-18 17:19:25'),
(39, 394, 83, 1284, 191, 424, 5, 'It was a good experience as always.', '2014-08-15 22:39:30', '2014-08-18 17:24:30'),
(40, 394, 82, 1283, 191, 424, 5, 'The instructor is fun! He is really passionate about training! He is soo positive and will find the perfect words to keep you motivated.', '2014-07-27 00:27:53', '2014-08-18 17:27:53'),
(41, 402, 109, 1297, 203, 425, 4, 'No mercy on us, but that’s what fitness is all about I guess! ', '2014-08-04 11:30:22', '2014-08-18 17:30:22'),
(42, 394, 87, 1285, 191, 426, 2, 'Not a fan of outdoor workout when it rains... ', '2014-08-15 20:32:37', '2014-08-18 17:32:37'),
(43, 394, 84, 1284, 191, 426, 4, 'You don''t only work your legs, bump or arms. Your entire body is working! It was not too busy, good chilled atmosphere. Would recommend to anyone.', '2014-08-07 04:34:13', '2014-08-18 17:34:13'),
(44, 394, 75, 1281, 191, 428, 4, 'That was cool!! Cheers Louis.', '2014-08-17 05:37:14', '2014-08-18 17:37:14'),
(45, 401, 101, 1294, 202, 429, 5, 'Oh MY! I felt so gooood! When is the next session? Any late classes available? (if not, please take it into consideration)', '2014-08-18 17:40:23', '2014-08-18 17:40:23'),
(46, 394, 91, 1289, 193, 430, 3, 'It hurts, but it''s good right?! ', '2014-07-30 19:41:17', '2014-08-18 17:41:17'),
(47, 394, 88, 1286, 193, 430, 4, 'That rain wasn''t a friend but we all enjoyed the session and had a great time together. Thanks guys! It was good exercising with yall! ', '2014-08-16 09:42:21', '2014-08-18 17:42:21'),
(48, 394, 85, 1284, 191, 431, 5, 'Advice: No nails.. Seriously. (But it was fun tho) ^^', '2014-08-04 10:43:28', '2014-08-18 17:43:28'),
(49, 401, 94, 1292, 202, 432, 4, 'Good as usual Nelson! SO proud of you! ', '2014-08-13 18:44:59', '2014-08-18 17:44:59'),
(50, 401, 95, 1292, 202, 434, 5, 'I was quite surprised to see a few men there.. But it was good though! It was a great session! ', '2014-07-25 17:49:37', '2014-08-18 17:49:37'),
(51, 394, 86, 1284, 191, 435, 4, 'It was great talking to you after the session Louis! ', '2014-08-09 02:56:33', '2014-08-18 17:56:33'),
(52, 402, 103, 1295, 203, 435, 4, 'My abs LOVED it! lol! ', '2014-08-06 17:58:06', '2014-08-18 17:58:06'),
(53, 394, 89, 1287, 193, 436, 5, 'Good session mate! ', '2014-08-03 10:59:38', '2014-08-18 17:59:38'),
(54, 401, 96, 1292, 202, 443, 4, 'Great class! Perfect after a long and stressful day at work', '2014-07-29 18:09:42', '2014-08-18 18:09:42'),
(55, 394, 90, 1288, 193, 447, 5, 'Louis is not playing with those sessions... I am glad to have a personal trainer that knows the words dedication & commitment! Thanks for that dude! ', '2014-07-30 13:13:19', '2014-08-18 18:13:19');
