(11, 11, 'Born in Sicily on the sunny coast of Palermo, Antonino started to work in the fitness industry in 1997 teaching aerobics, fitness classes and personal training.\r\nHe competed in aerobic, hip-hop and break-dance competitions as well as swimming events and triathlons.\r\nIn London Antonino works as a personal trainer and has gained a Diploma in Sport and Remedial Massage Therapy at the London School of Sport Massage, a Diploma in Anatomy and Physiology and he is studying for a Master in Osteopathy.', 'www.theitalianjob.me.uk', 1, 0, '', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
