(18, 90, 'Sally Lovett teaches hatha, vinyasa flow and yin yoga in yoga studios, local spaces, living rooms and office boardrooms in London, Brighton and on retreats throughout Europe. Sally has been practicing yoga for 10 years and teaching for 3. Combining dynamic vinyasa flow, with quieter ??in??poses to digest and absorb the practice, Sally encourages students to understand their physical limitations, explore their capabilities and deepen their practice.  Sally founded her yoga company, Stretching the', 'www.stretchingthecity.com', 1, 0, 'hatha, vinyasa flow and yoga', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
