(42, 145, 'Evercise is an online network that gives \neveryone wanting to exercise access to fitness instructors and classes across London.\nWe understand that if you have a busy lifestyle,\nyou can''t necessarily commit to a rigid fitness regime. That''s what makes Evercise different.\nYou can choose your class by location, trainer or type, and you don''t need to sign up for a whole course at once,\nyou can join on a class-by-class basis.\nYour fitness: your terms. After joining a class, you will receive a booking', 'www.evercise.com', 1, 0, 'Aerobics Coach', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(43, 149, 'Music festival lovers and fitness fans will be excited to hear that they can now combine their two passions. BIG BURN is a new fitness event that offers a spectacular festival atmosphere with 1,500 people working out together at Alexandra Palace on 30 / 31 May.\n\nSessions will be lead by celebrity instructors, including Darcey Bussell and Josie Gibson who will help you get in shape for the summer!\nLook forward to tons of fun as you and your friends share this unique opportunity to dance your sock', 'http://bigburn.co.uk/index.html', 1, 0, 'Aerobics Fitness instructor', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(44, 154, 'Regular Weekly Belly Dancing Classes with Jalya in Central London, near Marble Arch! \nCLASS DAY, TIME, LEVEL, LOCATION AND PRICE\n\nThursday 18:00-19:00 = Beginner/Intermediate. Studio 3. The Seymour Leisure Centre, W1H 5TJ. Â£9 drop-in.\n\nSaturday 15:00-17:00 = Beginner/Intermediate/Advance. Studio 1. The Seymour Leisure Centre, W1H 5TJ. Â£12 drop-in. PLUS BONUS Hula Hooping after the Belly Dancing class for the full core workout! Great Hen Party Weekend Activity Idea!\n\nSimply Drop-in and Pay As Y', 'http://www.jalyabellydancer.com/', 1, 0, 'Dance Fitness instructor', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(45, 156, 'Fully qualified fitness instructor with background in martial arts.', '', 1, 0, 'Kickboxing Fitness instructor', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(46, 157, 'Head trainer Corrie McCallum has dedicated her life to the fitness industry following a career as a professional dancer in the West End.\n\nShe teaches Yoga, Pilates, PT, Nutrition and Meditation to a wide variety of clients and heads up a team of highly qualified trainers.\n\nAll the trainers at Stretch Breathe Smile are considered specialists in their fields and are generally all round lovely chaps!\n\nWe pride ourselves on being a happy, healthy, enthusiastic team and live to spread the fitness lov', 'www.stretchbreathesmile.com', 1, 0, 'Yoga Personal Trainer', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(47, 162, 'Ginu Azucar\r\n\r\nBorn in Colombia in 1974, Ginu started dancing in the late 80''s for the Folklorike group ''Silvio Daza'' and ''Hugo Benavidez'' dance school. Ginu became passionate about dancing and roller skating, creating his own group when his was 16. He moved to the big city of Santa Fe de Bogota in 1985 to study computer science and joined the folkloric dance group of University Politecnico, Gran Colombiano where he toured and performed around Colombia for 5 years until he finished his s degree ', 'www.clubazucar.co.uk', 1, 0, 'Zumba Fitness instructor', '2014-07-17 15:41:32', '2014-08-01 10:03:33'),
(48, 164, ' Kayla is a qualified pool yoga instructor with 5 years of experience helping swimmers improve strength and flexibility in the pool. She is excited to meet new swimmers and help them improve their practice while decreasing chances of injury. She loves canoeing and camping, and is very happy to be a part of the evercise team', '', 1, 0, 'Boot Camp Coach', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(49, 166, 'Born in Colombia, Catalina knows what a real Zumba Party is about. Unmissable! ', 'www.malocauk.com', 1, 0, 'Zumba Fitness instructor', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(50, 168, 'Jenny is dedicated to healthy living for life, with 12 years experience as a fitness instructor offering weight management and exercise in order to maintain a healthy body & healthy mind.. Being part of the Evercise team offers the opportunity to meet new people and helping them to adapt to a healthier lifestyle.', '', 1, 0, 'Aerobics Fitness instructor', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(51, 168, 'Jenny is dedicated to making you feel Fitter, healthier and happier. With 12 years experience as a fitness Instructor I am happy to be part of the Evercise team ', '', 1, 0, 'Aerobics Fitness instructor', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(52, 169, 'I am really good', '', 1, 0, 'Aqua Aerobics Coach', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(53, 171, 'After graduate in "Physical Fitness and Health in Sports and Exercise", a specialized and targeted education to deal with the real challenges of Exercise and Health world, I have the necessary skills to develop all the required tasks to work as Fitness Trainer. With 5 years of working experience, I have improved my skills in more specific areas, as Group Exercise Instructor, Team Trainer, Personal Trainer and Fitness Coach.\nBesides that, I also accomplished the curriculum part of a Master in "Ex', 'www.aquafitproltd.co.uk', 1, 0, 'Aqua Aerobics Coach', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
