(57, 182, 'Ballet Body Sculpture is a unique fitness exercise program for all women who would like to develop elegance, posture, toned body, flexibility and sculpture the figure of their dreams. \n\nThe classes of Ballet Body Sculpture will improve: \nPosture, Body Line & Grace \nCoordination & Body Balance \nFlexibility, Freedom of Movement & Body Strength \nArticulations & Body Tone \nExpression, Artistry & Confidence \n\nNo previous experience in ballet is necessary to join. The classes are structured using tech', 'www.balletbodysculpture.com', 1, 0, 'Dance Coach', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(58, 183, 'Izabela is certified Beachbody INSANITY trainer, Level 2 REP, fitness and health enthusiast. Her group Insanity Classes help people achieve various fitness goals: weigh loss, body conditioning, getting stronger and fitter. ', 'Www.belivefitness.com', 1, 0, 'Strength and Conditioning Fitness instructor', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(59, 141, 'I have been a personal trainer since 1996. I run bootcamps and train athletes for marathon or special events such as bootcamps. ', '', 1, 0, 'Personal trainer', '2014-07-17 15:41:32', '2014-07-29 14:39:29'),
(60, 193, 'I am a wellness & transformational coach for children (7-14) & parents. I also love dancing and share this through my dance fitness classes :) \nArriane Eva Morrin\nâ€ Prevention & Transformational coach for Children (7-14) AemHealthandFitness >>> Workshops & Private work \nâ˜¯ Holistic Fitness instructor BellyfitÂ® UK with Aem\nDance Fitness instructor TYGAÂ® UK with Aem\n\nTel: + 44 (0)797 590 4903 \nwww.aemhealthandfitness.com\ninfo@aemhealthandfitness.com', 'www.aemhealthandfitness.com', 1, 0, 'Dance Fitness instructor', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(61, 194, 'Burlexercise is a medium - high intensity fitness class designed specifically for an all over body workout. Our classes take you on a physical journey, burning calories, toning and tightening all those problem areas from top to bottom, whilst incorporating token showgirl elements. \n \nOur focus is to get you fit, in shape and feeling body confident but most importantly we''ll make sure you are having fun exercising!\n \nThe creators of Burlexercise have taken inspiration from their careers as London', 'www.burlexercise.co.uk', 1, 0, 'Aerobics Fitness instructor', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(62, 195, 'i have been teaching variuos martial arts and boxing for over 28 yrs', 'www.gymlondonsouth.com', 1, 0, 'Kickboxing Coach', '2014-07-17 15:41:32', '2014-07-17 15:41:32'),
(63, 199, 'After injuring her knees and coming upon yoga by mere  curiosity, Dulce has found her way to feel healthier and fitter than ever, lighter and strong at the same time, and of top of it all, she feels happy, which for her should be one of the aims when you practice yoga. \nShe now wants to share yoga to you and get you to experience it. Her yoga practice includes Vinyasa and Power Yoga. ', 'https://www.facebook.com/yogalindolondon', 1, 0, 'Yoga Fitness instructor', '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(64, 200, 'My name is Adrian and I am from Transilvania. I have been teaching Krav Maga for 8 years in London and operate from Soho Gyms in London Waterloo. I will teach you how to be safe on the streets of London. I will show yuo how to defend yourself against all kinds of attacks, how to escape from Chokes, Locks, Bear Hugs and all kinds of holds. I have classes every week on Mondays and Tuesdays. You learn quickly as there is no theory! We teach only what works! Also the techniques are based on your bod', 'www.kravmaga-system.co.uk', 1, 0, 'Kickboxing Martial Artist', '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
