(82, 217, 'What is Jumping Â® ?\nJumpingÂ® is an original and dynamic fitness workout on patented and specially design JumpingÂ® PROFI trampolines using typical aerobic exercise, however not on solid surface but using a soft trampoline strung in a hexagonal shape. JumpingÂ® is combination of exercises and stretching.\nJumpingÂ® is a safe and fun way to strengthen your body and mind and is specifically designed to suit the needs of all age groups and brings about fun, physical well being and mental balance. T', 'www.jumpingfitnessbritain.com', 1, 0, 'Aerobics Facilities Manager', '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(83, 216, 'Jumping Julia has created a fitness program that is suitable for anyone, no matter what his or her age, weight or fitness level, suitable for mother to lose baby weight and cooperate people to release stress from whole day. Jumping Julia fitness Classes are not just random jumping on trampolines. It is dynamic an aerobic exercise accompanied with music and led by professional jumping instructor. ', 'www.jumpingfitnessbritain.com', 1, 0, 'Jumping Julia', '2014-07-17 15:41:33', '2014-08-13 15:31:05'),
(84, 222, 'Mark has nearly 30 years experience in coaching fitness and martial arts athletes from a range of physical disciplines. He is highly knowledgeable and enthusiastic about Functional Fitness Training having spent years working some the very best combat athletes. He has a relaxed coaching style which makes him great fun to work with. Come see for yourself.', 'www.gymlabfitness.com', 1, 0, 'Strength and Conditioning Coach', '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(85, 227, 'I came to Pilates as rehabilitation for my own back pain caused by Scoliosis and immediately fell in love with this exercise method. It brought me greater mobility, alignment and ease. I decided to train and qualified as a teacher for both mat and equipment Pilates. I also went on to complete further training in Exercise Management for Low Back Pain. I continue to extend my knowledge and interest in the human body by attending training courses.\nI have a very hands on approach to teaching and tho', '', 1, 0, 'Pilates Physical Activity instructor', '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(86, 226, 'I came to Pilates as rehabilitation for my own back pain caused by Scoliosis and immediately fell in love with this exercise method. It brought me greater mobility, alignment and ease. I decided to train and qualified as a teacher for both mat and equipment Pilates. I also went on to complete further training in Exercise Management for Low Back Pain. I continue to extend my knowledge and interest in the human body by attending training courses. I have a very hands on approach to teaching and tho', '', 1, 0, 'Pilates Physical Activity instructor', '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(87, 228, 'Specialist in Nutrition, Fat Loss, Stress Relief and Pain Reduction / Elimination\nTo me, Personal Training is exactly that - Personal\nMy belief is that effective communication and the ability to encourage and motivate are the best skills needed to train people - NOT to bully them!\nThat''s why it is important to establish a relationship so that we can work out what may be stopping you from achieving your goals and face any potential issues together', 'www.strictlyleemiller.co.uk', 1, 0, 'Fat Loss Personal Trainer', '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
(88, 242, 'Netball Coach, Triathlon Coach, Leader in Runner Fitness, passionate about introducing kids to a lifestyle of sports and fitness, and bringing adults back into sports and a fit life they once enjoyed', '', 1, 0, 'Beginner''s Fit Fitness instructor', '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
