(91, 250, 'Fabrice is a natural motivator and leader, an Ex-Amateur Boxer, Qualified Gym instructor,football coach, tennis coach, \nPrevious to setting up Muscle Hustle  was a Sports Facilitator for The Prince''s Trust designing sports programs for youth that focused on developing their interpersonal skills through exercise, sports and physical activities.\nProvides 1 to 1 sessions as well  as couples sessions, group sessions, bootcamps and corporate fun days.\nUsing a wide range of training tactics and method', 'www.muscle-hustle.co.uk', 1, 0, 'Boxercise Fitness instructor', '2014-07-17 15:41:33', '2014-07-17 15:41:33'),
