(114, 364, 'Ever since my mum gave me my first gym membership as a gift when I was 16 years old, I was hooked on fitness.  It has been a way of life for me, and for the past decade, it has also comprised my professional life.  After studying for a Sports Science Degree, I trained with Future Fit where I qualified as an Advanced Personal Trainer and Core Stability Master.  I then earned further qualifications at the American College of Sports Medicine in Miami, Florida. I have recently refreshed my Pre/Post.', 'www.themoose.uk.com', 1, 0, 'Personal Trainer  - ', '2014-08-04 13:26:38', '2014-08-05 07:41:44'),
(119, 373, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi non lacus id sapien porttitor facilisis. Nunc egestas justo magna, nec eleifend lorem vehicula in. Sed at vehicula lectus. Fusce blandit erat blandit, pretium ipsum in, hendrerit dui. Integer venenatis ac mi sed eleifend. Cras quis dui elit. Etiam quis nulla eget mauris convallis ultricies. Nam vel quam commodo, dictum lacus quis, vulputate sem. Quisque interdum facilisis turpis a dictum. Suspendisse mollis nunc sit amet dui sagittis', '', 1, 0, 'Awesomeness', '2014-08-05 12:12:58', '2014-08-05 12:18:02'),
(120, 378, 'Tanya is a certified INSANITY instructor & INSANITY Pro Team member which means she is dedicated to delivering Shaun T''s fat shredding MAX Interval Training workout with ultimate motivation to make you DIG DEEP!\r\n\r\nShe also holds Level 2 Certificate in Exercise to Music, certificate in Suspended Movement Training (TRX) and is currently completing a Diploma in Nutrition which she is extremely passionate about. \r\n\r\nTanya lives and breathes health, fitness & INSANITY.', 'www.londoninsaniacs.co.uk', 1, 0, 'INSANITY Instructor & Pro Team Member', '2014-08-07 10:14:46', '2014-08-07 11:18:22'),
(122, 379, 'GMMA Academy stands for Gukwoone and GuruMuayThai Mixed Martial Arts school.\r\nWe specialise in martial arts and helping our students get to another level in whatever they wanna achieve by training with us.\r\nOur Highest experienced and qualified coaches and fighters going to help yo train like a champion!\r\nClasses open for all levels of fitness,no martial arts experienced required.', 'http://gmma.co.uk/?reqp=1&reqr=nzcdYaEvLaE5pv', 1, 0, '"Thaiboxing"  and "Gukwoone MMA" classes,"PT".', '2014-08-08 14:03:52', '2014-08-08 14:40:16'),
(123, 384, ' iHuman Fitness is a Group exercising, Yoga, Pilates and Personal Training outdoor/indoor initiative. We want to help the local community enjoy training outdoors/indoors, get healthier and have over all a greater wellbeing- by providing healthy, intelligent training all year round.\r\n \r\niHuman Fitness provides innovative group fitness solutions for the local community and is revolutionising the fitness market.\r\n \r\nWith iHuman Fitness, you will get more than just a workout. ', 'http://www.ihumanfitness.co.uk', 1, 0, 'Instructor', '2014-08-12 12:26:06', '2014-08-12 12:26:49'),
(124, 394, 'I’ve been running bootcamps and weight loss programs since 2004. \r\n\r\nI focus on personal training and outdoor bootcamps. My classes and sessions are based in South of London. \r\nUsing supportive and motivational routines, I will lead you through a fitness session designed to help you get into the best shape of your life.\r\n\r\n', '', 1, 0, 'Personal trainer', '2014-08-15 09:32:56', '2014-08-15 11:53:10'),
(125, 395, 'My name is Adrian and I have been teaching Krav Maga for 8 years. I am Expert Level 1 and one of only a handful of experts in the UK\r\n\r\nI teach in Soho Gyms, Waterloo, London\r\n\r\n', 'www.kravmaga-system.co.uk', 1, 0, 'Krav Maga Self Defence Instructor', '2014-08-15 09:47:08', '2014-08-15 11:52:51'),
(126, 397, 'Regardless of your goals. No matter where you’re at physically, I have a personal training program that will get you to new heights of energy. Imagine being able to get more done in less time, increasing your memory, having a clearer mind. Yes, these things and more are all a result of consistent exercise program. Whether you have issues doing it on your own, or need some inspiration or techniques to make your workout more effective. I have personal training programs that will fit your needs.', '', 1, 0, 'Personal trainer', '2014-08-15 11:19:03', '2014-08-15 11:53:04'),
(127, 398, 'I know that wherever you are in your fitness (in shape, or no shape) it’s easy to get off track, or even get started. This is exactly the primary reason why I become a Personal Trainer.\r\n#NeverGiveUp is my motto.', '', 1, 0, 'Fitness Coach', '2014-08-15 11:31:00', '2014-08-15 11:52:59'),
(128, 401, 'I always knew I enjoyed yoga, and I practiced in my lounge room off and on for about ten years. Then, I build up my own studion in East London to create a very unique atmosphere for me and my students.\r\n\r\nI love teaching yoga because it has helped me immeasurably on so many levels and I believe everyone can benefit from regular yoga practice, no matter what their background. ', '', 1, 0, 'Yoga Teacher', '2014-08-15 12:41:43', '2014-08-15 13:20:30'),
(129, 402, ' I fell in love with fitness as a teeanager and turned that passion into my career in my 20''s. I''ve always had to work hard to have the body I want so I know what it takes to work for your results and am commited to helping others do the same. I do not believe in fad diets, quick fixes, or extreme measures for getting results. I believe in the proven consistency of smart choices, discipline, and a healthy balance in all areas.﻿\r\nDetermination is key.', '', 1, 0, 'Fitness Instructor', '2014-08-15 13:11:30', '2014-08-15 13:20:35'),
(130, 440, 'I am an yoga instructor in Central London. Come and join some exciting yoga classes!!', '', 0, 0, 'Yoga Instructor', '2014-08-18 09:25:25', '2014-08-18 09:25:25'),
(131, 461, 'Been a qualified fitness professional since 2007.  After several years of training people in groups and one-to-one I believe I know how to advise and instruct all groups and levels in finding a more active person within. ', 'www.fit4purpose.weebly.com', 1, 0, 'Personal Trainer/Group Exercise coach', '2014-08-18 11:48:38', '2014-08-18 13:19:13');
